        require(stor10[msg.sender] == 1, "Caller is not an administrator");
        if (_status) {
            stor10[_identifier] = 1;
        } else {
            stor10[_identifier] = 0;
        }
    }

    function disableInitialStage() public {
        require(stor10[msg.sender] == 1, "Caller is not an administrator");
        onlyAmbassadors = 0;
    }

    function setStakingRequirement(uint256 _amountOfTokens) public {
        require(stor10[msg.sender] == 1, "Caller is not an administrator");
        stakingRequirement = _amountOfTokens;
    }

    function withdraw() public {
        uint256 _dividends = (balanceOf[msg.sender] * stor9) - stor6[msg.sender];
        // additional safety mechanism
        if (_dividends > 0) {
            stor6[msg.sender] +=  _dividends;
            stor5[msg.sender] = 0;
            msg.sender.transfer(_dividends);
        }
        emit onWithdraw(msg.sender, _dividends);
